import React, { Component } from 'react';
import Header from '../components/Header';

export default class Search extends Component {
  render() {
    return (
      <div data-testid="page-search">
        <Header />
        <form>
          <input type="text" data-testid="search-artist-input" />
        </form>
      </div>
    );
  }
}
